import React from 'react'

const Header=({handleToggleDarkMode})=> {
    return (
        <div className='header'>
            <h1 >Note</h1>
            <button onClick={()=>
                handleToggleDarkMode(
                    (previousDarkMode)=>!previousDarkMode
                    )} 
                    className='save1'>TOGGLE</button>
                    
        </div>
    )
}

export default Header
